import styled from "styled-components";

const MyPageContainer = styled.div`
  margin: 0 !important;
  justify-content: center;
  background-color: white;
  flex-direction: column;
  height: calc() (var(--mobile-screen) + 40vh);
  font-size: 4rem;
`;

const MyPageGNB = styled.h1`
  letter-spacing: 0.5rem;
`;

const StaticInfos = styled.div`
  width: 100%;
  margin: 0rem;
  display: flex;
  flex-direction: column;
  padding: 4rem 5vw;
  padding-top: 17.5rem;
  font-size: 3rem;
`;

const StaticInfo = styled.span`
  padding: 1rem 0;
`;

const UpdateForm = styled.form``;

const UpdateHeader = styled.h1`
  font-size: 3rem;
`;

const UpdateLabel = styled.label`
  font-size: 2.5rem;
`;

const UpdateInput = styled.input`
  width: 90vw !important;
`;

const UpdateBTN = styled.button``;

function MyPage() {
  return (
    <div id="GlobalContainer">
      <MyPageContainer className="container">
        <MyPageGNB className="gnb">My Page</MyPageGNB>
        <StaticInfos>
          <StaticInfo>이름: 홍길동</StaticInfo>
          <StaticInfo>회원 등급: 정회원</StaticInfo>
        </StaticInfos>

        <UpdateForm className="form">
          <UpdateHeader>개인정보 변경</UpdateHeader>
          <br />
          <UpdateLabel className="label">
            이메일:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            이전 비밀번호:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            새 비밀번호:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            새로운 비밀번호 확인:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            새 전화번호:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>

          <UpdateBTN className="submit_btn" type="submit">
            개인정보 변경
          </UpdateBTN>
        </UpdateForm>
      </MyPageContainer>
    </div>
  );
}

export default MyPage;
